//**THE MAP DETAILS**
This map is made to mirror either side, so its all about player skill, the map contains elavators that lead to sniper points on either side of the map. Free scouts for all aswell, just incase awps are banned, but there is plenty of cover for someone with a rifle to, which is great. So check out my map and tell me what u think.

